What happens when PUT_STATE failed somehow. For example,

```    // To company
    err = stub.PutState(accountPrefix+tr.ToCompany, toCompanyBytesToWrite)

    // From company
    err = stub.PutState(accountPrefix+tr.FromCompany, fromCompanyBytesToWrite)
    if err != nil {
        return nil, errors.New("Error writing the fromCompany back")
    }```

Assume PutState( ToCompany, &lt;json&gt;) succeeded, and the amount was increased or dereased. However, also assume PutState( FromCompany, &lt;json&gt;) failed, and world state does not changed.  My understanding is that,  this transaction in chaincode failed, as a result new block is not created. But I wonder what will happen in world state.
